В отличие от России здесь профилактическим мерам по уходу за зубами уделяется важнейшее значение.
Раз в год хожу на бесплатную клиническую чистку зубов в колледж, где обучают гигиенистов Нью Йорка - Dental Hygiene CUNY (The City University of New York). Чистка может длиться несколько часов, а то и несколько сеансов. Процедуру проводят студенты под тщательным руководством профессоров. Надо ли говорить о высоком качестве такой услуги? Когда в клинике полностью исследуют полость рта, делают снимки, а чистку осуществляют по всем нормативным требованиям. К примеру, когда идёшь по обычной страховке в стоматологию - качество всегда ожидает лучшего, процедура длится от силы 15-20 минут. Что наверное можно понять, когда в рядовых дентал офисах регулярный и неиссякаемый поток пациентов, это как конвейер.
Обычно я ловлю объявления на фейсбуке, либо в групповых мессенджерах, что требуются добровольцы.
Приятным бонусом клиника всегда выдаёт подарочный пакет, в который входит зубная щётка, паста, ополаскиватель, зубная нить, ёршики, маленькие песочные часы (для контроля времени ежедневной чистки, очень удобные), стоматологическое зеркало.
Все данные пациента хранятся в базе данных и в следующий визит можно увидеть динамику ухода за зубами.
Огромной популярностью в США пользуются программы обучения медсестёр Nursing и гигиенистов Dental Hygiene.
Я поинтересовалась процессом обучения гигиениста. Учёба длится 2 года, стоит в целом около $27к, что в принципе недорого, учитывая, что это инвестиция в будущее. Перед поступлением нужно сдать три экзамена: устный английский, письменный английский, математику (также если у вас нет медицинского образования до начала обучения необходимо добрать пререквизиты - дополнительные курсы: анатомия, биология, химия и пр. Может занять год-полтора). После окончания выдаётся лицензия штата и можно сразу приступать к работе в дентал офисе со стартовой зарплатой от $36/час до $65/час с опытом (в отличие от программы медсестёр, которым предстоит после окончания ещё 2 года интернатуры в медикал офисе). В год гигиенист в Нью-Йорке в среднем получает $66-120к. Как вам такая перспектива?

